window.bookSummaryJSON = "<p><b>Jump into Pride with Tan France (</b><b><i>Queer Eye</i></b><b>), Nikki Levy, and seven </b><b><i>fabulous </i></b><b>storytellers as they share true tales of exploring, embracing, and celebrating queer identity.</b>&nbsp;</p> <p><i>You Do You, </i>produced especially for Pride Month, brings Audible Members a collection of uplifting, raw, and hilarious stories from queer actors, comedians, and personalities. Co-hosted by French-tuck aficionado and super-stylist Tan France and storytelling maven Nikki Levy, <i>You Do You</i> is a fierce, unfiltered celebration of LGBTQIA+ realness.&nbsp;</p> <p>You’ll hear live stories from <i>RuPaul’s</i> <i>Drag Race</i> fave D.J. “Shangela” Pierce about seeking some Beyoncé healing after a fateful death-drop injury, Janine Brito (stand-up comedian and writer for Netflix’s <i>One Day at a Time</i>) who made a curious calendar purchase as a tween, and Emma Willmann (<i>Crazy Ex-Girlfriend</i>) growing closer to her sister through heteronormative wedding planning.&nbsp;</p> <p><i>You Do You</i> also treats listeners to a sometimes-fun, sometimes-trying excursion to Dubai from YouTube star Gigi Gorgeous, a mischievous switcheroo orchestrated by Percy Rustomji, and a touching story about big life decisions from Nikki Levy herself. Closing it out is a deeply personal story that’s still sizzling with laughs from the magnificent Alexandra Billings of Amazon’s hit show <i>Transparent</i>.&nbsp;</p> <p>So, celebrate yourself, don’t let anyone dull your sparkle, and dive in to the fabulous, funny stories in <i>You Do You</i>.&nbsp;</p> <p>Featuring stories told live on stage from the following performers:&nbsp;<br> </p> <ul> <li>Janine Brito</li> <li>D.J. “Shangela” Pierce</li> <li>Emma Willmann</li> <li>Gigi Gorgeous</li> <li>Percy Rustomji</li> <li>Nikki Levy</li> <li>Alexandra Billings</li> </ul> <p>Co-hosted by: Tan France and Nikki Levy&nbsp;</p>"; 
